// ✅ HomePage.js
import React from 'react';
import { Link } from 'react-router-dom';

function HomePage() {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>CivicFlow Portal</h1>
      <Link to="/signup?role=citizen"><button>Citizen Signup/Login</button></Link><br /><br />
      <Link to="/signup?role=authority"><button>Authority Signup/Login</button></Link>
    </div>
  );
}

export default HomePage;
